const UserInformation =(props) => {  
  return (
    <table className="table">
  <thead>
    <tr>
      <th scope="col">Имя</th>
      <th scope="col">Фамилия</th>
      <th scope="col">Username</th>
    </tr>
  </thead>
  <tbody>
}
props.userData.map (row=>(
    <tr>
      <td>Mark</td>
      <td>Otto</td>
      <td>@mdo</td>
    </tr>
))
  </tbody>
</table>

)

}






export default UserInformation;
